function updateCitySelect(voivodeshipSelect, citySelect, isAdmin = false) {
    const voivodeship = voivodeshipSelect.value;
    citySelect.innerHTML = '';
    
    if (!voivodeship) {
        citySelect.disabled = true;
        const defaultOption = document.createElement('option');
        defaultOption.value = '';
        defaultOption.textContent = isAdmin ? 'Najpierw wybierz województwo' : 'Najpierw wybierz województwo';
        citySelect.appendChild(defaultOption);
        return;
    }
    
    citySelect.disabled = false;
    const cities = citiesByVoivodeship[voivodeship];
    
    const defaultOption = document.createElement('option');
    defaultOption.value = '';
    defaultOption.textContent = isAdmin ? 'Wybierz miasto' : 'Wybierz miasto';
    citySelect.appendChild(defaultOption);
    
    cities.forEach(city => {
        const option = document.createElement('option');
        option.value = city.toLowerCase();
        option.textContent = city;
        citySelect.appendChild(option);
    });
}

document.addEventListener('DOMContentLoaded', function() {
    const urlParams = new URLSearchParams(window.location.search);
    const voivodeshipParam = urlParams.get('voivodeship');
    
    const voivodeshipSelect = document.getElementById('voivodeship');
    const citySelect = document.getElementById('city');
    const driverVoivodeshipSelect = document.getElementById('driverVoivodeship');
    const driverCitySelect = document.getElementById('driverCity');
    
    updateCitySelect(voivodeshipSelect, citySelect);
    updateCitySelect(driverVoivodeshipSelect, driverCitySelect, true);
    
    if (voivodeshipParam && voivodeshipSelect.querySelector(`option[value="${voivodeshipParam}"]`)) {
        voivodeshipSelect.value = voivodeshipParam;
        updateCitySelect(voivodeshipSelect, citySelect);
        searchDrivers();
    }
    
    voivodeshipSelect.addEventListener('change', function() {
        updateCitySelect(voivodeshipSelect, citySelect);
    });
    
    driverVoivodeshipSelect.addEventListener('change', function() {
        updateCitySelect(driverVoivodeshipSelect, driverCitySelect, true);
    });
});

document.getElementById('offerForm').addEventListener('submit', function(e) {
    e.preventDefault();
    searchDrivers();
});

function searchDrivers() {
    const voivodeship = document.getElementById('voivodeship').value;
    const city = document.getElementById('city').value;
    const carModel = document.getElementById('carModel').value;
    const serviceType = document.getElementById('serviceType').value;
    
    let filteredDrivers = drivers;
    
    if (voivodeship) {
        filteredDrivers = filteredDrivers.filter(driver => driver.voivodeship === voivodeship);
    }
    
    if (city) {
        filteredDrivers = filteredDrivers.filter(driver => driver.city === city);
    }
    
    if (carModel) {
        filteredDrivers = filteredDrivers.filter(driver => driver.carModel === carModel);
    }
    
    if (serviceType) {
        filteredDrivers = filteredDrivers.filter(driver => driver.serviceType === serviceType);
    }
    
    displayResults(filteredDrivers);
}

function displayResults(drivers) {
    const resultsContainer = document.getElementById('driversResults');
    const resultsCount = document.getElementById('resultsCount');
    
    resultsContainer.innerHTML = '';
    
    if (drivers.length === 0) {
        resultsCount.textContent = 'Nie znaleziono kierowców spełniających kryteria wyszukiwania';
        resultsContainer.innerHTML = '<div class="no-results">Brak wyników wyszukiwania</div>';
        return;
    }
    
    resultsCount.textContent = `Znaleziono ${drivers.length} kierowców spełniających kryteria wyszukiwania`;
    
    drivers.forEach(driver => {
        const carModelNames = {
            'skoda_octavia': 'Skoda Octavia',
            'toyota_corolla': 'Toyota Corolla',
            'audi_a6': 'Audi A6',
            'bmw_5': 'BMW Seria 5',
            'mercedes_e': 'Mercedes Klasy E',
            'tesla_model3': 'Tesla Model 3'
        };
        
        const serviceTypeNames = {
            'standard': 'Standard',
            'premium': 'Premium',
            'vip': 'VIP',
            'business': 'Business',
            'family': 'Family'
        };
        
        // Generate star rating
        const fullStars = Math.floor(driver.rating);
        const hasHalfStar = driver.rating % 1 >= 0.5;
        let starsHtml = '';
        
        for (let i = 0; i < fullStars; i++) {
            starsHtml += '★';
        }
        
        if (hasHalfStar) {
            starsHtml += '½';
        }
        
        const driverCard = document.createElement('div');
        driverCard.className = 'driver-card';
        driverCard.innerHTML = `
            <div class="availability ${driver.available ? 'available' : 'unavailable'}"></div>
            <img src="${driver.photo}" alt="${driver.firstName} ${driver.lastName}" class="driver-photo">
            <div class="driver-info">
                <h3>${driver.firstName} ${driver.lastName}</h3>
                <p>Wiek: ${driver.age} lat</p>
                <p>Doświadczenie: ${driver.experience} lat</p>
                <p>Ocena: ${driver.rating}/5</p>
            </div>
            <div class="car-model">
                <img src="${carImages[driver.carModel]}" alt="${carModelNames[driver.carModel]}">
                <p>${carModelNames[driver.carModel]}</p>
                <span class="service-type">${serviceTypeNames[driver.serviceType]}</span>
            </div>
            <div class="driver-expanded-info">
                <div class="expanded-details">
                    <h4>${driver.firstName} ${driver.lastName}</h4>
                    <p>Wiek: ${driver.age} lat</p>
                    <p>Doświadczenie: ${driver.experience} lat</p>
                    <div class="rating-stars" title="Ocena: ${driver.rating}/5">${starsHtml}</div>
                    <h4>Model samochodu</h4>
                    <p>${carModelNames[driver.carModel]}</p>
                    <h4>Typ usługi</h4>
                    <p>${serviceTypeNames[driver.serviceType]}</p>
                    <h4>Opis</h4>
                    <p>${driver.bio}</p>
                </div>
                <button class="reserve-btn" ${!driver.available ? 'disabled style="opacity:0.5; cursor:not-allowed;"' : ''}>
                    ${driver.available ? 'Zarezerwuj teraz' : 'Niedostępny'}
                </button>
            </div>
        `;

        const reserveBtn = driverCard.querySelector('.reserve-btn');
        if (reserveBtn && driver.available) {
            reserveBtn.addEventListener('click', function(e) {
                e.preventDefault();
                alert(`Rezerwacja kierowcy ${driver.firstName} ${driver.lastName} przebiegła pomyślnie!`);
            });
        }
        
        resultsContainer.appendChild(driverCard);
    });
}

document.getElementById('adminToggle').addEventListener('click', function(e) {
    e.preventDefault();
    const adminPanel = document.getElementById('adminPanel');
    adminPanel.style.display = adminPanel.style.display === 'none' ? 'block' : 'none';
    this.textContent = adminPanel.style.display === 'none' ? 'Panel Administracyjny' : 'Ukryj Panel';
});

document.getElementById('driverForm').addEventListener('submit', function(e) {
    e.preventDefault();
    
    const newDriver = {
        id: drivers.length + 1,
        firstName: document.getElementById('driverFirstName').value,
        lastName: document.getElementById('driverLastName').value,
        age: parseInt(document.getElementById('driverAge').value),
        voivodeship: document.getElementById('driverVoivodeship').value,
        city: document.getElementById('driverCity').value.toLowerCase(),
        available: document.getElementById('driverAvailable').value === 'true',
        carModel: document.getElementById('driverCarModel').value,
        serviceType: document.getElementById('driverServiceType').value,
        photo: document.getElementById('driverPhoto').value || 'https://randomuser.me/api/portraits/men/' + Math.floor(Math.random() * 100) + '.jpg',
        experience: parseInt(document.getElementById('driverExperience').value),
        rating: parseFloat(document.getElementById('driverRating').value),
        bio: document.getElementById('driverBio').value || "Profesjonalny kierowca z " + document.getElementById('driverExperience').value + "-letnim doświadczeniem."
    };
    
    drivers.push(newDriver);
    alert('Kierowca został dodany pomyślnie!');
    this.reset();

    document.getElementById('driverCity').innerHTML = '<option value="">Najpierw wybierz województwo</option>';
    document.getElementById('driverCity').disabled = true;

    searchDrivers();
});